import React from 'react';
import AppLayout from '../components/layout/AppLayout';
import { GoogleLogin } from 'react-google-login';

function login() {
    const responseGoogle = (res) => {
        console.log(res);
        console.log(res.profileObj.givenName); // 이름
        console.log(res.profileObj.imageUrl); // 프로필 사진 URL
    }

    const responseError = (err) => {
        console.log(err);
    }

    return (
        <AppLayout>
            <div>로그인페이지</div>
            <GoogleLogin
                clientId="327602985435-mva29i220rt081nsonv69tk5np0di0bq.apps.googleusercontent.com"
                buttonText="Login"
                onSuccess={responseGoogle}
                onFailure={responseError}
                cookiePolicy={'single_host_origin'}
            />
        </AppLayout>
    )
}

export default login
